INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('3', '68', '3', '0', 'Clamat Epicurus, is quem vos nimis voluptatibus esse deditum dicitis; non posse iucunde.', '2024-01-29 13:07:15');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('4', '45', '74', '2', 'Et ortum esse e corpore et ad corpus referri, nec.', '2024-01-29 13:15:48');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('5', '34', '16', '2', 'Ab Homero Ennius, Afranius a Menandro solet. Nec vero, ut noster Lucilius, recusabo, quo minus animus.', '2024-01-29 13:21:16');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('6', '15', '30', '1', 'Tantalo semper impendet, tum superstitio, qua qui utuntur, benivolentiam sibi conciliant et, quod aptissimum est ad cognitionem omnium, regula, ad quam omnia iudicia rerum in sensibus ponit, quibus si semel aliquid falsi pro vero probatum sit, sublatum esse omne iudicium veri et falsi putat. Confirmat autem illud vel maxime, quod ipsa natura divitias, quibus contenta sit.', '2024-01-29 13:23:26');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('7', '76', '4', '2', 'Fieri minus; ita effici complexiones.', '2024-01-29 13:32:37');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('8', '19', '78', '2', 'Dediti, alii petulantes, alii audaces, protervi.', '2024-01-29 13:39:59');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('9', '83', '43', '0', 'Utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis modum constituant in reque eo meliore, quo maior sit, mediocritatem desiderent. Sive enim ad minim veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi.', '2024-01-29 13:48:52');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('10', '46', '92', '4', 'Sed do eiusmod tempor incididunt ut labore et dolore disputandum putant. Sed.', '2024-01-29 13:53:11');
