INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('12', '5', '34', '3', 'Hoc quasi, provincias atomis dare, quae recte, quae oblique ferantur, deinde eadem illa atomorum, in quo admirer, cur.', '2024-01-29 14:03:59');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('13', '94', '6', '3', 'Conferebamus, neque erat umquam controversia, quid ego intellegerem, sed quid probarem. Quid igitur est? Inquit; audire enim cupio, quid non probes eius, a quo dissentias. Quid enim est una, quae maestitiam pellat ex animis, quae nos a libidinum impetu et a formidinum terrore vindicet.', '2024-01-29 14:10:36');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('14', '57', '75', '0', 'Autem alia malunt scribi a nobis, aequi esse debent, quod et posse fieri.', '2024-01-29 14:17:36');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('15', '35', '55', '0', 'Accusata et vituperata ab Hortensio. Qui liber cum et tibi probatus videretur et iis, quos ego posse iudicare arbitrarer, plura suscepi veritus ne movere.', '2024-01-29 14:23:28');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('16', '77', '83', '1', 'Solitudo et vita sine amicis insidiarum et metus et aegritudines.', '2024-01-29 14:30:37');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('17', '26', '89', '1', 'Quidem non admodum indoctis, totum hoc displicet philosophari. Quidam autem non tam id reprehendunt, si remissius agatur, sed.', '2024-01-29 14:38:08');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('18', '34', '55', '3', 'Autem detracta voluptate aegritudinem statim consequi, nisi in voluptatis locum dolor forte successerit, at contra gaudere nosmet omittendis doloribus, etiamsi voluptas ea.', '2024-01-29 14:39:40');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('19', '33', '94', '2', 'Debilitati obiecta specie voluptatis tradunt se libidinibus constringendos nec quid eventurum sit provident ob.', '2024-01-29 14:49:15');
