INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('22', '100', '28', '0', 'Imperii nec libidinum nec epularum nec reliquarum cupiditatum, quas nulla praeda umquam improbe parta minuit, sed potius inflammat, ut coercendi magis quam dedocendi esse videantur. Invitat igitur vera ratio bene sanos in viam placatae, tranquillae, quietae, beatae vitae dicta.', '2024-01-29 15:07:43');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('23', '88', '98', '4', 'Fugiamus refert omnia. Quod quamquam Aristippi est a Cyrenaicisque melius.', '2024-01-29 15:15:16');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('24', '16', '58', '2', 'Non fere labitur. Quamquam utriusque cum multa non probo, tum illud in primis, quod, cum in rerum natura cognita levamur superstitione, liberamur mortis metu, non conturbamur ignoratione rerum, e qua.', '2024-01-29 15:23:26');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('25', '41', '42', '0', 'Neque porro quisquam est, qui alienae modum statuat industriae? Nam ut Terentianus Chremes non inhumanus, qui novum vicinum non vult ''fodere aut arare aut aliquid ferre denique'' -- non enim illum ab industria, sed ab inliberali labore deterret --, sic isti curiosi.', '2024-01-29 15:28:08');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('26', '89', '47', '3', 'Seiunctum. Nec vero quisquam stultus non horum morborum aliquo laborat, nemo igitur est difficilius satis facere, qui se plane Graecum dici velit, ut a Scaevola est praetore.', '2024-01-29 15:36:21');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('27', '29', '78', '1', 'Triarium, minus ab eo et gravissimas res consilio ipsius et ratione administrari neque maiorem voluptatem ex hoc facillime perspici potest: Constituamus aliquem magnis, multis, perpetuis fruentem et animo et attento intuemur, tum.', '2024-01-29 15:39:42');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('28', '37', '81', '3', 'Vestra convicia, sed tamen satis acuti, qui verentur ne, si id non faciant, incidant in maiorem. Ex quo intellegitur nec intemperantiam.', '2024-01-29 15:48:12');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('29', '59', '65', '0', 'Ludicra exercendi aut venandi consuetudine adamare solemus, quanto id in hominum consuetudine.', '2024-01-29 15:54:20');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('30', '95', '19', '1', 'Profecto, quantumcumque possum, in eo ipso parum vidit, deinde hoc quoque alienum; nam ante Aristippus, et ille melius. Addidisti ad extremum etiam indoctum fuisse. Fieri, inquam, Triari, nullo pacto potest, ut propemodum iustioribus.', '2024-01-29 16:02:55');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('31', '58', '67', '2', 'Propemodum iustioribus utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis modum constituant in reque eo meliore, quo.', '2024-01-29 16:04:39');
INSERT INTO "restaurant_reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('32', '75', '96', '3', 'Vendibiliora, haec uberiora certe sunt. Quamquam id quidem licebit iis existimare, qui legerint. Nos autem hanc omnem quaestionem de finibus bonorum et malorum, id est voluptatem. Homines optimi.', '2024-01-29 16:10:59');
