INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('79', '42', '46', '4', 'Quicquid porro animo cernimus, id omne oritur a sensibus; qui si omnes veri erunt, ut Epicuri ratio docet, tum denique.', '2024-01-29 19:58:20');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('80', '77', '52', '1', 'Erga nos amice et benivole collegisti, nec me tamen laudandis maioribus meis corrupisti nec segniorem ad respondendum reddidisti. Quorum facta quem ad modum eae semper voluptatibus inhaererent, eadem de amicitia dicenda sunt. Praeclare enim Epicurus his paene verbis: ''Eadem'', inquit, ''scientia confirmavit animum, ne.', '2024-01-29 20:05:30');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('81', '84', '2', '3', 'Commodius disserendum viam. In physicis plurimum posuit. Ea scientia et verborum vis et natura orationis.', '2024-01-29 20:09:25');
