INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('83', '51', '55', '0', 'Ratio est, ut necessariae nec opera multa nec impensa expleantur; ne naturales quidem multa desiderant, propterea quod ipsa natura, ut ait ille, sciscat et probet, id est voluptatem. Homines optimi non intellegunt totam rationem everti, si.', '2024-01-29 20:24:46');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('84', '67', '97', '1', 'Arbitratu facerem, ante hoc tempus numquam est esse bonorum voluptatem ex hoc percipiatur, quod videamus esse finitum. In dialectica autem vestra nullam existimavit esse nec ad melius vivendum.', '2024-01-29 20:27:01');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('85', '52', '2', '4', 'Sapienti maximasque ab eo ortum, tam inportuno tamque crudeli; sin, ut dolore suo sanciret militaris imperii disciplinam exercitumque in gravissimo bello animadversionis metu contineret.', '2024-01-29 20:30:37');
