INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('89', '6', '73', '3', 'Nec impediente nec inpendente, quem tandem hoc statu praestabiliorem aut magis expetendum possimus dicere? Inesse enim necesse est in voluptate aut in liberos atque in sanguinem suum tam crudelis fuisse, nihil ut de omni virtute sit dictum. Sed similia fere dici possunt. Ut enim.', '2024-01-29 20:52:17');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('90', '43', '16', '2', 'Omne animal, simul atque natum sit, voluptatem appetere eaque gaudere ut summo bono, dolorem aspernari ut summum malum.', '2024-01-29 20:55:02');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('91', '2', '18', '2', 'Habeat. Nam si concederetur, etiamsi ad corpus nihil referatur, ista sua sponte et per se ipsam optabilem, sed quia maiores consequatur. Eadem fortitudinis ratio reperietur. Nam neque laborum.', '2024-01-29 21:01:59');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('92', '55', '54', '2', 'Aut molestiam plus aut ad naturam aut contra sit, a natura ipsa iudicari. Ea quid percipit aut quid malum, sensu iudicari, sed animo etiam ac ratione intellegi posse et voluptatem ipsam per se esset et virtus.', '2024-01-29 21:07:48');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('93', '78', '24', '0', 'Voluptatibus, sic amicitiae non posse iucunde vivi, nisi sapienter, honeste iusteque vivatur, nec sapienter, honeste, iuste, nisi iucunde. Neque enim civitas in seditione beata esse potest nec in malis dolor, non existimant oportere nimium nos causae confidere, sed et.', '2024-01-29 21:16:52');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('94', '44', '88', '0', 'Sit. Erit enim iam de omnium virtutum cursu ad voluptatem proprius disserendi locus. Nunc autem explicabo, voluptas ipsa quae qualisque sit, ut tollatur error omnis imperitorum intellegaturque.', '2024-01-29 21:24:16');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('95', '45', '26', '2', 'Accusata et vituperata ab Hortensio. Qui liber cum et tibi probatus videretur et iis, quos ego posse iudicare.', '2024-01-29 21:29:50');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('96', '7', '5', '1', 'Aptius. Quibus ex omnibus iudicari potest non modo nullam captet, sed etiam cogitemus; infinitio ipsa, quam apeirian vocant, tota ab illo est, tum innumerabiles mundi, qui.', '2024-01-29 21:35:21');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('97', '40', '3', '4', 'Dolore detracto, nam quoniam, cum privamur dolore, ipsa liberatione et vacuitate omnis molestiae gaudemus, omne autem id, quo gaudemus, voluptas est, ut Epicuro placet, nihil dolere, primum tibi recte, Chrysippe, concessum est.', '2024-01-29 21:43:12');
INSERT INTO "reviews" ("review_id", "customer_id", "restaurant_id", "rating", "review_text", "created_at") VALUES ('98', '88', '66', '0', 'Quod et acutum genus est et ab Epicuro sapiens semper beatus inducitur: finitas habet cupiditates, neglegit mortem, de diis inmortalibus sine ullo metu vera sentit, non dubitat, si ita melius sit, migrare de vita. His rebus peccant, cum e quibus haec efficiantur ignorant. Animi autem morbi sunt cupiditates inmensae et inanes divitiarum.', '2024-01-29 21:49:26');
